import { Link } from 'react-router-dom';
import PageContent from '../components/PageContent';

function HomePage() {
  return (
    <PageContent title="admin page !">
      <button><Link to="/auth">let's start</Link></button>
    </PageContent>
  );
}

export default HomePage;
